import React from 'react';
import logo from './logo.svg';
import './App.css';

function App() {
  return (
    <div className="App">
      <header className="App-header">
        <img src={logo} className="App-logo" alt="logo" />
        <h1 className="h3 mb-3 font-weight-normal">Login</h1>
        <label htmlFor="inputEmail" className="sr only">Email Adress</label>
        <input type="email" id="inputEmail" className="form-control mb-2" required autoFocus/>
        <label htmlFor="inputPassword" className="sr only">Password</label>
        <input type="password" id="inputPassword" className="form-control mb-2" required/>
      </header>
    </div>
  );
}

export default App;
